import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import { Button, Container, Card, CardContent, Divider } from "@mui/material";

// Example cover image import (replace with your actual image)
import coverImage from "../../images/developerCover.png"; // Adjust path accordingly

const BuildOnAlkebuleum = () => {
  const useCases = [
    {
      title: "Decentralized Finance (DeFi)",
      description: "Build platforms to help underbanked communities access financial services securely and transparently.",
    },
    {
      title: "Supply Chain Management",
      description: "Create transparent and efficient supply chain solutions for industries using blockchain technology.",
    },
    {
      title: "Social Impact Platforms",
      description: "Leverage blockchain to address societal issues, enabling communities to collaborate and solve real-world challenges.",
    },
    {
      title: "NFT Marketplaces",
      description: "Develop decentralized marketplaces for digital assets, offering creators a new way to monetize their work.",
    },
    {
      title: "Governance & Voting",
      description: "Implement decentralized voting systems that ensure secure, transparent, and fair decision-making processes for communities and organizations.",
    },
  ];

  return (
    <Box sx={{ py: 10, bgcolor: "white", position: "relative" }} id="buildonalkebuleum">
      <Container maxWidth="lg">
        <Grid container spacing={5} alignItems="center" justifyContent="center">
          {/* Left Side: Cover Image */}
          <Grid item xs={12} md={6}>
            <Box
              component="img"
              src={coverImage}
              alt="Build on Alkebuleum"
              sx={{
                width: "80%",  // Reduced width to 80% as in previous section
                height: "auto",
                borderRadius: "8px",
                boxShadow: "0px 4px 12px rgba(0, 0, 0, 0.1)",
              }}
            />
          </Grid>

          {/* Right Side: Content */}
          <Grid item xs={12} md={6}>
            {/* Tag above the title */}
            <Box
              sx={{
                backgroundColor: "rgba(208, 233, 239, 0.5)", // Variation of #D0E9EF with transparency
                color: "#7BA6AC", // Dark grey for text contrast
                px: 3,
                py: 1,
                borderRadius: "20px",
                fontSize: "14px",
                textTransform: "uppercase",
                mb: 2,  // Add margin below the tag
                display: "inline-block", // Make the tag size match text length
              }}
            >
              Developers
            </Box>
            <Typography
              variant="h4"
              component="h2"
              sx={{ fontWeight: "bold", mb: 3, color: "#333", textAlign: { xs: "center", sm: "left" } }}
            >
              Build on Alkebuleum
            </Typography>

            {/* Description Content */}
            <Typography
              variant="body1"
              color="textSecondary"
              sx={{ mb: 4, lineHeight: 1.7, textAlign: { xs: "center", sm: "left" } }}
            >
              Alkebuleum provides the perfect platform for developers to create decentralized applications that address
              real-world challenges. Explore some of the possibilities:
            </Typography>

            {/* Use Cases List as Cards */}
            <Grid container spacing={2}>
              {useCases.map((useCase, index) => (
                <Grid item xs={12} sm={6} key={index}>
                  <Card sx={{ height: "100%", boxShadow: "0px 4px 12px rgba(0, 0, 0, 0.1)", borderRadius: "8px" }}>
                    <CardContent>
                      <Typography variant="h6" component="div" sx={{ fontWeight: "bold", mb: 1 }}>
                        {useCase.title}
                      </Typography>
                      <Typography variant="body2" color="textSecondary">
                        {useCase.description}
                      </Typography>
                    </CardContent>
                  </Card>
                </Grid>
              ))}
            </Grid>

            {/* Divider */}
            <Divider sx={{ my: 4 }} />

            {/* Call-to-Action Button */}
            <Box sx={{ textAlign: { xs: "center", sm: "left" } }}>
              <Button
                component="a"
                href="/learn-more"  // Replace with actual learn more link
                variant="contained"
                sx={{
                  backgroundColor: "#A97855",
                  color: "white",
                  padding: "10px 24px",
                  fontSize: "16px",
                  borderRadius: "8px",
                  "&:hover": {
                    backgroundColor: "#f9d0ba",
                  },
                }}
              >
                Learn More
              </Button>
            </Box>
          </Grid>
        </Grid>
      </Container>
    </Box>
  );
};

export default BuildOnAlkebuleum;
